/* styles */


/* components */
import Head from './common/Head/index';

const Navbar = () => {
    return (
        <div>
            <ul>
                <li><a href="http://localhost:3000/root/index">Home</a></li>
                <li><a href="http://localhost:3000/root/blog">Blog</a></li>
                <li><a href="http://localhost:3000/root/about">About</a></li>
                <li><a href="http://localhost:3000/root/contact">Contact</a></li>
            </ul>
        </div>
    );
}


export default Navbar;
